  const argTargetDir = formatTargetDir(argv._[0]);
  // \u83B7\u53D6\u4F20\u5165\u7684\u6A21\u677F \u2014\u2014 react-ts(\u53EF\u4EE5\u7528 --template \u6216\u8005 -t \u4F20\u5165\u6A21\u677F)
